const CarInfo = (props) => {
  return (
    <div className="car-info">
      <ul>
        <li>brand: 'BMW'</li>
        <li>series: 'E46'</li>
        <li>model: '320'</li>
        <li>year: 2002</li>
        <li>engine: 'Diesel'</li>
        <li>mileage: 234600</li>
      </ul>
    </div>
  );
};

export default CarInfo;
